import React from "react";
import Card from "./Card";
import "./CardView.css";
import { Link } from "react-router-dom";

function CardView(props) {
  const items = props.cards.find((item) => item.id === 3);
  const data = [];
  for (let i = 0; i < items.count; i++) {
    data.push({
      id: i + 1,
      volume: items.volume[i],
      Rupee: items.Rupee[i],
      Save: items.Save[i],
    });
  }
  //console.log(data);
  const handleClick = () => {
    // Access the card using the id and pass it to another component or do any other operations
    // const datatoconfirm = props.data.find((item) => item.id === id);
    // card.id
    console.log(5);
  };

  return (
    <div className="card-view">
      {data.map((card) => (
        <Link
          style={{ textDecoration: "none" }}
          to="/Confirm"
          onClick={() => handleClick()}
        >
          <Card
            key={card.id}
            volume={card.volume}
            Rupee={card.Rupee}
            Save={card.Save}
          />
        </Link>
      ))}
    </div>
  );
}

export default CardView;
